    render() {     
        return (  
            <div>  
              <h1> Name { this.props.name } </h1> 
              <h2> Age{ this.props.age } </h2>     
              <p> <h4> Javatpoint is one of the best Java training institute in Noida, Delhi, Gurugram, Ghaziabad and Faridabad. </h4> </p>          
            </div>  
        );  
     }  

}

App.defaultProps = {  
    name: "JavaTpoint"  

 }  


export default PropsDemo;
